import React, {useState} from "react";


const ToDo = (props) => {
    return(
        <div>
            {props.list
            .map(choose => (
            <div onClick = {event => props.addDone(choose)} key = {choose.lp}>{choose.lp}. {choose.text}, {choose.date}</div>
            ))}
        </div>
    )
}

export default ToDo;
